	static public string LookupMaterial(string name)
	{
		string result;
		if(m_materials.TryGetValue(name, out result)){
			return result;
		}
		return null;
	}

	static public string LookupPrefab(string name)
	{
		string result;
		if(m_prefabs.TryGetValue(name, out result)){
			return result;
		}
		return null;
	}

